		return function;
	}

	public ProteinStructure getProtein() {
		return protein;
	}

	public void setProtein(ProteinStructure protein) {
		this.protein = (ProteinStructure) protein;
	}

	public final List getCisRegulators() {
		return cisRegulators;
	}

